import style from  './Weather.module.scss'
import {Card} from "react-bootstrap";
import  image from '../../assets/weather/reshot-icon-thunderstorm-KA23SLGT5H.svg'
export  const Weather = (props) => {
    return (
        <>
            <Card className={`text-center ${style.container}`}>
                <Card.Body>
                    <Card.Title >Casablanca MA</Card.Title>
                    <Card.Text as={'div'}  className={`${style.weatherInfo}`}>
                        <div>
                            <img src={image} alt="Image"/>
                        </div>
                        <div>Temperature : 35 C</div>
                        <div>Last Update : 15H22MIN</div>
                    </Card.Text>
                </Card.Body>
            </Card>
        </>
    );
};
